import './component.css';
import {Component} from "react";
const emailPattern = /^(([^<>()\[\]\\.,;:\s@"]+(\.[^<>()\[\]\\.,;:\s@"]+)*)|(".+"))@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}])|(([a-zA-Z\-0-9]+\.)+[a-zA-Z]{2,}))$/;

class Signup extends Component {

constructor(){
    super()
    this.state = {
        emailError:'',
      email:''

      };
    }
    email=()=>{
        this.setState({
            email:this.state.email
        })
    }
    handleTouchTap = () => {
        if(this.state.email == '' || this.state.email == null){
          this.setState({
          emailError: "Email cannot be empty"
        });
        }
        else if (!emailPattern.test(this.state.email) && this.state.email.length > 0) {
          this.setState({
            emailError: "Enter a valid email"
          });
        }
        else{

          let data = {};
          data.email = this.state.email;
          // this.props.registerUser(data);
        }
      };

      changeEmail = (evt) => {
          alert(this.state.email);
        if(this.handleTouchTap()){
            alert("sdwas"+this.state.email);
            this.setState({
                email: evt.target.value
              });
        }

      }

     render(){
         return(
            <div className="container signup ">
            <div className="row justify-content-center">
            <div className="col-md-5">
             <div className="card">
               <h2 className="card-title text-center">Register</h2>
                <div className="card-body py-md-4">
                 <form _lpchecked="1">
                    <div className="form-group">
                       <input type="text" className="signup form-control" id="name" placeholder="Name"/>
                  </div>
                  <div className="form-group">
                       <input type="text" className="signup form-control" name="email"  vvalue={this.state.email} onChange={this.changeEmail} placeholder="Email"/>
                       <p class="help-block help-block-error">{this.state.emailError}</p>
                                      </div>


             <div className="form-group">
               <input type="password" className="signup form-control" id="password" placeholder="Password"/>
             </div>
             <div className="form-group">
                <input type="password" className="signup form-control" id="confirm-password" placeholder="confirm-password"/>
             </div>
             <div className="d-flex flex-row align-items-center justify-content-between">
            <button className=" signup btn btn-primary" >Create Account</button>
                    </div>
                 </form>
               </div>
            </div>
          </div>
          </div>
          </div>
         )
     }
}

export default Signup
